import React from "react";

interface IImageCardDada {
  link: string;
  firstHeader: string;
  secondHeader: string;
  imageUrl: string;
  //   style: React.CSSProperties;
  headerGap: React.CSSProperties;
}

export const ImageCard = ({
  link,
  firstHeader,
  secondHeader,
  imageUrl,
}: IImageCardDada) => {
  return (
    <a href={link}>
      <div className="position-align" style={headerGap}>
        <span>{firstHeader}</span>
        <span>{secondHeader}</span>
      </div>
      <div>
        <img src={imageUrl} alt="card-image" className="card-image-size" />
      </div>
    </a>
  );
};
